import './App.css';
import CveTable from './components/CveTable.js';
import Linecharts from './components/Linecharts.js';
import Dankmemes from './components/Dankmemes.js'
function App() {
  return (
    <div className="App">

      <div>
        CVE Analysis
        <CveTable />
      </div>

      <div>
        <Linecharts />
      </div>
      <div>
        <Dankmemes />
      </div>

    </div>
  );
}

export default App;
